import { BrowserRouter } from "react-router-dom"
import Clock from "./Clock"
import NavBar from "./NavBar"
import Radio from "./Radio"
import { Route } from "react-router"

export default class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <Clock />
        <Radio />
      </React.Fragment>
    )
  }
}
